import React, {Component} from 'react';

class Education extends Component {
    render() {
        return (
            <div>
                <table>
                    <thead>
                        <th>Duration</th>
                        <th>Level</th>
                        <th>Institution</th>

                    </thead>
                </table>

            </div>
        );
    }
}

export default Education;
